window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"17.1.1","implementation":{"name":"cucumber-jvm","version":"7.2.3"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"11.0.11+9-LTS-194"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1644095117,"nanos":878342600}}},{"source":{"uri":"file:///C:/Users/Azize/IdeaProjects/mycucumberproject/./src/test/resources/features/firstfeaturefile.feature","data":"#All feature files must start with feature keyword. There can be ONLY 1 feature per file.\r\n#Feature describes the overall test case\r\n#It can be the user story name\r\n# Google_Search_Functionality or we can use like this  Google Search Functionality   without underscore\r\n@google_search\r\nFeature: Google_Search_Functionality\r\n#Scenario = Test Case\r\n#We can do more than one scenario\r\n#Under Scenario, we will have TEST STEPS\r\n#Given, And, Then, When, But, *annotations\r\n#These are Gherkin language\r\n#EACH STEP MUST START WITH A GHERKIN KEYWORD\r\n#Given should be used as preconditions\r\n#Then should be used for verifications\r\n#And and When should be used in the middle steps\r\n  Background: user_is_on_the_google_page\r\n #Background keyword is used before each Scenario keyword\r\n #Background is used for repeated pre conditions.\r\n #It can't be used after Scenario keyword, so use it first\r\n    Given user is on the google page\r\n  @iphone_search\r\n  Scenario: TC01_iphone_search\r\n    When user search for iPhone on google\r\n    Then verify the result has iPhone related results\r\n    Then capture the screenshot\r\n    Then close the application\r\n\r\n#We can create multiple Scenarios\r\n  @teapot_search @wip\r\n  Scenario: TC02_teapot_search\r\n    When user search for Tea Pot on google\r\n    Then verify the result has Tea Pot related results\r\n    Then capture the screenshot\r\n\r\n#Flower\r\n  @flower_search @wip\r\n  #@wip means work in progress\r\n  Scenario: TC03_flower_search\r\n    When user search for flower on google\r\n    Then verify the result has flower related results\r\n    Then capture the screenshot\r\n\r\n#What is a feature file?\r\n#We write our test scenarios in feature files.\r\n#We use Gherkin language in the feature files such as Feature, Scenario, Given, And, Then, When, But, Background,...\r\n#It is written in plain English\r\n#Known as non technical part. Everybody can read and understand\r\n\r\n#What is a step definition?\r\n#We write our Java code in the step definitions\r\n#This has the technical part.Only technical people can understand\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Azize/IdeaProjects/mycucumberproject/./src/test/resources/features/firstfeaturefile.feature","feature":{"location":{"line":6,"column":1},"tags":[{"location":{"line":5,"column":1},"name":"@google_search","id":"e992a685-3b4e-4c40-8987-083657210ee8"}],"language":"en","keyword":"Feature","name":"Google_Search_Functionality","description":"","children":[{"background":{"location":{"line":16,"column":3},"keyword":"Background","name":"user_is_on_the_google_page","description":"","steps":[{"location":{"line":20,"column":5},"keyword":"Given ","text":"user is on the google page","id":"269af25f-5fa2-47d1-ab45-dcbc656931b3"}],"id":"439828fb-5067-4735-985e-d3a50c5aa7eb"}},{"scenario":{"location":{"line":22,"column":3},"tags":[{"location":{"line":21,"column":3},"name":"@iphone_search","id":"a306c3a7-20fa-4830-8b64-318393b82417"}],"keyword":"Scenario","name":"TC01_iphone_search","description":"","steps":[{"location":{"line":23,"column":5},"keyword":"When ","text":"user search for iPhone on google","id":"c1a24d30-84c9-4994-b300-39371d385c65"},{"location":{"line":24,"column":5},"keyword":"Then ","text":"verify the result has iPhone related results","id":"81f027af-ecdb-4060-9f99-3bf5242a19de"},{"location":{"line":25,"column":5},"keyword":"Then ","text":"capture the screenshot","id":"3092a565-a60c-4918-b47
